import React from "react"

class Comp extends React.Component{
    constructor(props){
    super(props);
    this.state ={
        name:"Vasile",
        age : "20",
        isLoggedIn : false,
        loggMsg : ""
        };  
    }

    loginCheck () {
        if(this.state.isLoggedIn === false)
            this.setState.loggMsg = "out";
        else
            this.setState.loggMsg = "in";
    }
  
    render()
    {
        let msg;
        if(this.state.loginCheck === true)
        {
            msg = "in";
        }
        else{
            msg = "out";
        }
        return(
            <div>
                <p>Comp</p>
                <h1>Nume:{this.state.name}</h1>
                <h2>Age:{this.state.age}</h2>
                <h3>Logging:{msg}</h3>
            </div>
        )
    }
}

export default Comp
